processors/custom_your_own_processor.htm.body:
custom your own processor
write a simple processor
function MyProcessor(cube) {
    this.cube = cube;
}
MyProcessor.type = 'script';
MyProcessor.ext = '.js';

MyProcessor.prototype.process = function (data, callback) {
    var err = null;
    /**
     data can be {
        queryPath:
        realPath:
        code: {String}
        source: {String}
        compress: {Boolean}
        wrap: {Boolean}
     }
     **/
    callback(err, data);
}

